    return(
        <form className={classes.form}>
            <Input label="Amount" input={{
                id:'amount',
                type:'number',
                min:'1',
                max:'5',
                step:''

            }}/>
            <button>+ Add</button>
        </form>
    );
};

export default MealItemForum;
